CREATE TABLE customer_feedback (
  feedback_id INT PRIMARY KEY,
  customer_id INT,
  transcript TEXT,
  sentiment_score FLOAT
);

CREATE TABLE customer_feedback (
  feedback_id INTEGER PRIMARY KEY,
  customer_id INTEGER,
  feedback_text TEXT,
  voice_transcript TEXT
);

CREATE TABLE feedback_analysis (
  analysis_id INTEGER PRIMARY KEY,
  feedback_id INTEGER,
  analysis_result TEXT
);

CREATE TABLE feedback_transcripts (
    feedback_id INT PRIMARY KEY,
    customer_id INT,
    transcript TEXT
);

CREATE TABLE customer_sentiments (
    sentiment_id INT PRIMARY KEY,
    feedback_id INT,
    sentiment_score FLOAT,
    sentiment_category VARCHAR(50)
);

CREATE TABLE analysis_results (
    analysis_id INT PRIMARY KEY,
    feedback_id INT,
    analysis_result JSON
);

CREATE TABLE CustomerFeedback (
    feedback_id INT PRIMARY KEY,
    transcript_id INT,
    feedback_text TEXT,
    feedback_date DATE
);

CREATE TABLE Transcript (
    transcript_id INT PRIMARY KEY,
    audio_file_id INT,
    transcribed_text TEXT,
    speaker_id INT
);

CREATE TABLE AudioFile (
    audio_file_id INT PRIMARY KEY,
    file_name VARCHAR(255),
    file_path VARCHAR(255),
    file_size INT
);

CREATE TABLE Speaker (
    speaker_id INT PRIMARY KEY,
    speaker_name VARCHAR(50),
    speaker_gender VARCHAR(10)
);

CREATE TABLE CustomerDetails (
    customer_id INT PRIMARY KEY,
    customer_name VARCHAR(50),
    email_address VARCHAR(100),
    phone_number VARCHAR(15)
);

CREATE TABLE SentimentAnalysis (
    analysis_id INT PRIMARY KEY,
    feedback_id INT,
    sentiment_analysis TEXT,
    analysis_date TIMESTAMP
);

CREATE TABLE VoiceTranscript (
    transcript_id INT PRIMARY KEY,
    feedback_id INT,
    transcript TEXT,
    transcript_date TIMESTAMP
);
